import React from 'react'
import { connect } from 'react-redux'
import { fetchUserData } from '../actionCreators/userActions'

import { Progress } from 'react-sweet-progress';
import "react-sweet-progress/lib/style.css";

class SleepContainer extends React.Component {

  componentDidMount() {
    this.props.fetchData(`https://api.fitbit.com/1.2/user/-/sleep/date/2018-12-16.json`)
  }

  render() {
    return (
      <div>
        <div className='progress-circle'>
          <Progress
            type="circle"
            width={300}
            strokeWidth={10}
            percent={75}
          /><br /><br />
          Sleep Efficiency
        </div>
      </div>
    )
  }
}

const mapStateToProps = state => {
  return {
    token: state.token
  }
}

const mapDispatchToProps = dispatch => {
  return {
    fetchData: url => dispatch(fetchUserData(url, this.state.token))
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(SleepContainer)
